import About from "./main/About";
import Faq from "./main/Faq";
import Pricing from "./main/Pricing";
import Prize from "./main/Prize";
import Value from "./main/Value";

const Main = () => {
    return (
        <main id="main">

            <About/>
            <Value/>
            <Prize/>
            <Pricing/>
            <Faq/>

        </main>

    );
}

export default Main;
